import React, { useState } from "react";
import axios from 'axios'

const LoginButton = () => {

    const logout = () => {
        axios
            .delete("http://localhost:3000/logout")
            .then((res) => {
                console.log(res)
            }
        )
    }

    const handleClick = () => {
        logout()
    }

    return (
        <button onClick={handleClick}>Login</button>
    )
}

export default LoginButton
